import { createActions } from 'reduxsauce';

const { Types, Creators } = createActions({
  googleSignIn: [],
  emailSignIn: ['data'],
  signInSuccess: ['currentUser'],
  signInFailure: ['error'],
  signOut: [],
  signOutSuccess: [],
  signOutFailure: ['error'],
  signUpSuccess: ['currentUser'],
  signUpFailure: ['error'],
  checkUserSession: []
});

export { Types, Creators };
